import React from 'react'
import { Feature } from '../../components';
import './whatGPT3.css';

const WhatGPT3 = () => {
  return (
    <div className='gpt3__whatgpt3 section__margin' id='wpt3'>
      <div className="gpt3__whatgpt3-feature">
        <Feature/>
      </div>
    </div>
  )
}

export default WhatGPT3
